  false,\n\t\"url\": null,\n\t\"notes\": \"This disk or set of disks contain high-resolution
  multibeam and backscatter maps of the south-western corner of the Pulley Ridge Area,
  near the Tortugas, in the Gulf of Mexico. It includes the following products: 1)
  *.ASC File of the area mapped, 2) Caris files of the bathymetry, 3) Geotiff images
  of bathymetry, and 4) Fledermaus files of the survey locations. All products are
  available contacting the distributor. Another product that will not be distributed,
  but will be used as input to habitat classification software (QTC MultiView), are
  raw data files logged to disk using the Simrad EM3000 multibeam system data acquisition
  software. These raw files contain packets of information (depth soundings, navigation,
  attitude, sound velocity profiles, UTC time) that the acquisition software logged
  sequentially in time. The raw data format is available from Kongsberg-Simrad. The
  multibeam system was provided by University of South Florida, College of Marine
  Science and the support vessel was the Florida Institute of Oceanography R/V Suncoaster.\",\n\t\"owner_org\":
